import './NoticeItem.module.scss';
import styles from './NoticeItem.module.scss';

const NoticeItem = ({notice}) => {
    const {com, content, createdAt, owner, title} = notice;

    return(
        <div className={styles.body}>
            {title}
        </div>
    )
}

export default NoticeItem;
